        $(document).ready(function () {
            $(function () {

                $("".add-to-cart"").click(function () {
                    var productid = $('#ProductsId').val();
                    var soluong = $('#txtsoluong').val();
                    $.ajax({

                        url: '/api/cart/add',
                        type: ""POST"",
                        dataType: ""JSON"",
                        data: {
                            productid: productid,
                            amout: soluong
                        },
                        success: function (response) {

                                loadHeaderCart();
                                location.reload();


                        },
                        error: function (error) {
                            alert(""There was an error posting the data to the sever:"" + error.responseText);
                        },
                    });

                });
            })");
                WriteLiteral(";\r\n\r\n            function loadHeaderCart() {\r\n\r\n                $(\"#miniCart\").load(\"/AjaxContent/HeaderCart\");\r\n                $(\"#numberCart\").load(\"/AjaxContent/NumberCart\");\r\n            }\r\n\r\n        });\r\n    </script>\r\n    ");
            }
            );
        }
